(149, 2, '2013-01-03 10:11:37', '2013-01-03 16:11:37', 'This post tests comments in the following ways.\n<ul>\n	<li>Threaded comments up to 10 levels deep</li>\n	<li>Paginated comments (set <em><strong>Settings &gt; Discussion &gt; Break comments into pages</strong></em> to <em><strong>5</strong></em> top level comments per page)</li>\n	<li>Comment markup / formatting</li>\n	<li>Comment images</li>\n	<li>Comment videos</li>\n	<li>Author comments</li>\n	<li>Gravatars and default fallbacks</li>\n</ul>\n&nbsp;', 'Comments', '', 'publish', 'open', 'closed', '', 'comments', '', '', '2013-01-03 10:11:37', '2013-01-03 16:11:37', '', 0, 'http://wpthemetestdata.wordpress.com/2007/09/04/comment-test/', 0, 'post', '', 21),
(151, 2, '2013-01-01 10:17:18', '2013-01-01 16:17:18', 'This post has many pingpacks and trackbacks.\n\nThere are a few ways to list them.\n<ol>\n	<li>Above the comments</li>\n	<li>Below the comments</li>\n	<li>Included within the normal flow of comments</li>\n</ol>', 'Pingbacks And Trackbacks', '', 'publish', 'closed', 'closed', '', 'pingbacks-an-trackbacks', '', '', '2013-01-01 10:17:18', '2013-01-01 16:17:18', '', 0, 'http://wpthemetestdata.wordpress.com/2007/09/04/many-trackbacks/', 0, 'post', '', 5),
