(555, 2, '2012-12-10 10:00:14', '2012-12-10 16:00:14', '[gallery]\n\n<!--nextpage-->\n\nYou can use this page to test the Theme''s handling of the[gallery]\n\nshortcode, including the <code>columns</code> parameter, from 1 to 10 columns. Themes are only required to support the default setting (3 columns), so this page is entirely optional.\n<h2>One Column</h2>\n[gallery columns="1"]\n<h2>Two Columns</h2>\n[gallery columns="2"]\n<h2>Three Columns</h2>\n[gallery columns="3"]\n<h2>Four Columns</h2>\n[gallery columns="4"]\n<h2>Five Columns</h2>\n[gallery columns="5"]\n<h2>Six Columns</h2>\n[gallery columns="6"]\n<h2>Seven Columns</h2>\n[gallery columns="7"]\n<h2>Eight Columns</h2>\n[gallery columns="8"]\n<h2>Nine Columns</h2>\n[gallery columns="9"]\n<h2>Ten Columns</h2>\n[gallery columns="10"]', 'Post Format: Gallery', '', 'publish', 'open', 'open', '', 'post-format-gallery', '', '', '2012-12-10 10:00:14', '2012-12-10 16:00:14', '', 0, 'http://wpthemetestdata.wordpress.com/?p=555', 0, 'post', '', 0),
(559, 3, '2012-12-09 09:00:54', '2012-12-09 15:00:54', 'We fundamentally believe that our customers are more interested in a simple, attractive, and functional WordPress theme than they are having 12 color schemes to choose from, and a fancy slider with 8 transition effects.\n\nIf you pick out a WordPress theme like you pick out drapes, you’re doing something wrong.', 'Post Format: Aside', '', 'publish', 'open', 'open', '', 'post-format-aside', '', '', '2012-12-09 09:00:54', '2012-12-09 15:00:54', '', 0, 'http://wpthemetestdata.wordpress.com/?p=559', 0, 'post', '', 0),
