(1064, 2, '2013-03-15 17:56:11', '2013-03-15 22:56:11', 'Note that you will probably want to test this page in conjunction with the <strong>Blog</strong> page.\n\nTo test this page:\n<ul>\n	<li>Navigate to <strong><em>Settings &gt; Reading</em></strong> in the WordPress admin.</li>\n	<li>Then use the settings in the screenshot below.</li>\n</ul>\n<img class="alignnone size-full wp-image-1071" alt="Static Pages" src="http://localhost/learn/wp-content/uploads/2013/03/static-pages.png" width="1390" height="1022" />\n\nA few things to check once this is done.\n<ul>\n	<li>Navigating to the root URL loads this page.</li>\n	<li>The site title should be an <code>H1</code> and the page title should be an <code>H2</code> (if displayed).</li>\n	<li>Check that the browser window / tab name is what you intend it to show.</li>\n	<li>If your theme displays breadcrumbs, they should probably not show when this page is the front page.</li>\n</ul>', 'Home', '', 'publish', 'open', 'open', '', 'home', '', '', '2013-03-15 17:56:11', '2013-03-15 22:56:11', '', 0, 'http://wptest.io/demo/?page_id=1064', 0, 'page', '', 0),
(1066, 2, '2013-03-15 17:59:55', '2013-03-15 22:59:55', 'Note that you will probably want to test this page in conjunction with the <strong>Home</strong> page.\n\nTo test this page:\n<ul>\n	<li>Navigate to <strong><em>Settings &gt; Reading</em></strong> in the WordPress admin.</li>\n	<li>Then use the settings in the screenshot below.</li>\n</ul>\n<img class="alignnone size-full wp-image-1071" alt="Static Pages" src="http://localhost/learn/wp-content/uploads/2013/03/static-pages.png" width="1390" height="1022" />\n\nA few things to check once this is done.\n<ul>\n	<li>Navigating to the Blog page does <strong>not</strong> display this page. It should display blog posts.</li>\n	<li>Check that the browser window / tab name is what you intend it to show.</li>\n	<li>If your theme displays breadcrumbs, they should probably not show when this is the posts page.</li>\n</ul>', 'Blog', '', 'publish', 'open', 'open', '', 'blog', '', '', '2013-03-15 17:59:55', '2013-03-15 22:59:55', '', 0, 'http://wptest.io/demo/?page_id=1066', 0, 'page', '', 0),
