(1363, 1, '2018-05-09 04:59:19', '2018-05-09 04:59:19', 'This is a test for Jetpack''s Tiled Gallery.\r\n\r\nYou can install <a title="Jetpack for WordPress" href="http://jetpack.me/" target="_blank" rel="noopener">Jetpack</a> or <a title="Slim Jetpack" href="http://wordpress.org/extend/plugins/slimjetpack/" target="_blank" rel="noopener">Slim Jetpack</a> to test it out.\r\n\r\n[gallery type="rectangular" columns="9" ids="1261,1038,1039,1040,1041,1042" orderby="rand"]\r\n\r\nThis is some text after the Tiled Gallery just to make sure that everything spaces nicely.', 'Tiled Gallery', '', 'inherit', 'closed', 'closed', '', '1031-revision-v1', '', '', '2018-05-09 04:59:19', '2018-05-09 04:59:19', '', 1031, 'http://localhost/learn/2018/05/09/1031-revision-v1/', 0, 'revision', '', 0),
(1364, 1, '2018-05-09 05:06:20', '2018-05-09 05:06:20', 'This is a test for Jetpack''s Tiled Gallery.\r\n\r\nYou can install <a title="Jetpack for WordPress" href="http://jetpack.me/" target="_blank" rel="noopener">Jetpack</a> or <a title="Slim Jetpack" href="http://wordpress.org/extend/plugins/slimjetpack/" target="_blank" rel="noopener">Slim Jetpack</a> to test it out.\r\n\r\n[gallery type="rectangular" ids="1261,1038,1039,1040,1041,1042" orderby="rand"]\r\n\r\nThis is some text after the Tiled Gallery just to make sure that everything spaces nicely.', 'Tiled Gallery', '', 'inherit', 'closed', 'closed', '', '1031-revision-v1', '', '', '2018-05-09 05:06:20', '2018-05-09 05:06:20', '', 1031, 'http://localhost/learn/2018/05/09/1031-revision-v1/', 0, 'revision', '', 0),
(1365, 1, '2018-05-09 05:25:16', '2018-05-09 05:25:16', 'This is a sticky post.\r\n\r\nThere are a few things to verify:\r\n<ul>\r\n 	<li>The sticky post should be distinctly recognizable in some way in comparison to normal posts. You can style the <code>.sticky</code> class if you are using the <a title="WordPress Codex post_class() Function" href="http://codex.wordpress.org/Function_Reference/post_class" target="_blank" rel="noopener">post_class()</a> function to generate your post classes, which is a best practice.</li>\r\n 	<li>They should show at the very top of the blog index page, even though they could be several posts back chronologically.</li>\r\n 	<li>They should still show up again in their chronologically correct postion in time, but without the sticky indicator.</li>\r\n 	<li>If you have a plugin or widget that lists popular posts or comments, make sure that this sticky post is not always at the top of those lists unless it really is popular.</li>\r\n</ul>', 'Sticky', '', 'inherit', 'closed', 'closed', '', '1241-revision-v1', '', '', '2018-05-09 05:25:16', '2018-05-09 05:25:16', '', 1241, 'http://localhost/learn/2018/05/09/1241-revision-v1/', 0, 'revision', '', 0),
