(1419, 1, '2018-06-10 08:04:44', '2018-06-10 08:04:44', '<a title="WP Test - The Best Tests For WordPress" href="http://wptest.io" target="_blank" rel="noopener">WP Test</a> is a fantastically exhaustive set of test data to measure the integrity of your plugins and themes.\r\n\r\nThe foundation of these tests are derived from <a title="Theme Unit Test" href="http://codex.wordpress.org/Theme_Unit_Test" target="_blank" rel="noopener">WordPress’ Theme Unit Test Codex</a> data. It’s paired with lessons learned from over three years of theme and plugin support, and baffling corner cases, to create a potent cocktail of simulated, quirky user content.\r\n\r\nThe word "comprehensive" was purposely left off this description. It''s not. There will always be something new squarely scenario to test. That''s where you come in. <span style="color: #ff0000;"><a style="color: #ff0000;" title="Contact" href="http://wptest.io/contact/">Let us know</a></span> of a test we''re not covering. We''d love to squash it.\r\n\r\nLet’s make WordPress testing easier and resilient together.', 'About', '', 'inherit', 'closed', 'closed', '', '1086-revision-v1', '', '', '2018-06-10 08:04:44', '2018-06-10 08:04:44', '', 1086, 'http://localhost/learn/?p=1419', 0, 'revision', '', 0),
